import React, { Component } from 'react';
import './TableArt.css'

class TableArt extends Component {
  delete = () => {

  }
  render() {



    const tableDates = this.props.dates.map((dateRow) => { let cont = 0;
        <tr>
          {  dateRow.map((date) => <td>
             {date}
             cont += 1;
             {cont === 5 ? <a className="btn circle ired" onClick={this.add}>x</a>:null}
          </td> ) } 
        </tr>}
    );

    const tableFields = this.props.fields.map((field) => 
      <th>
        {field}
      </th>
    );

    return (
      <div className="tableArt">
        <table>
	      <thead>
	      <tr>
	      	{tableFields}
	      </tr>
	      </thead>
	      <tbody>
	        {tableDates}
	      </tbody>
        </table>
      </div>
    );
  }
}

export default TableArt;
